import React, {useState} from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import FileUploadPage from './pages/Upload'
import ReturnsPage from './pages/Returns';
import { elements } from 'chart.js';

function App() {
  const [fileUploaded, setFileUploaded] = useState(false)

  const handleFileUploadSuccess = () => {
    setFileUploaded(true)
  }

  const PrivateRoute = ({ element } : {element : any}) => {
    return fileUploaded ? element : <Navigate to="/" />;
  };


  return (
    <Router>
        <Routes>
            <Route path='/' element={<FileUploadPage onFileUpload={handleFileUploadSuccess} />} />
            <Route path='/protected' element= {<PrivateRoute element={<ReturnsPage />} />} />
        </Routes>
    </Router>
  )

}

export default App;
